<!DOCTYPE html>
<html>
    <head>
        <title>Docking Example</title>
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0, user-scalable=no, minimal-ui">
        <script src="../../build/3Dmol.js"></script>
        <style>
        	* {margin:0; padding:0}
        </style>

        <script>
            var glviewer = null;


            $(document).ready(function() {
                
                try {
                    
                    glviewer = $3Dmol.createViewer("gldiv", {defaultcolors: $3Dmol.rasmolElementColors});                    
                    glviewer.setBackgroundColor(0xffffff);
                    var rec = glviewer.addModel($('#rec').val(),'pdb');
                    var lig = glviewer.addModel($('#lig').val(),'pdb');
                    rec.setStyle({}, {cartoon: {}});
                    lig.setStyle({}, {stick: {radius:0.15}});
                    glviewer.addSurface($3Dmol.SurfaceType.MS,{colorscheme: 'whiteCarbon',opacity:0.95},{model: rec}, {model: rec});
                    glviewer.zoomTo();
                    
                    var sdfs = $('#docked').val().split('$$$$\n');
                    var sdfmodels = [];
                    for(var i = 0; i < sdfs.length; i++) {
						if(sdfs[i].length > 0) {
							var m = glviewer.addModel(sdfs[i],"sdf");
							m.setStyle({},{stick:{colorscheme:"greenCarbon"}});
							m.hide();
							sdfmodels.push(m);
						}
					}
					
					var currmol = 0;
					var display = function() {
						sdfmodels[currmol].hide();
						currmol = (currmol+1) % sdfmodels.length;
						sdfmodels[currmol].show();
						glviewer.render();
					};
					setInterval(display, 500);
                    glviewer.render();
                    
                    
                }
                
                catch (e) {
                    console.error("Could not instantiate viewer from supplied url: '" + e + "'");
                }

                
            });
        </script>
